.icon-text {
    display: block;
    overflow: hidden;
    width: 60px !important;
    font-size: 12px;
    font-weight: 300;
    color: black;
    text-overflow: ellipsis;
}

.icon-photos {
    color: black;
    display: flex;
    flex-direction: column;
    margin: 1rem;
    align-items: center;
    text-align: center;
    width: 60px;
    text-overflow: ellipsis;
}

.icon-photos:hover {
    cursor: pointer;
}

.icon-photos:focus .icon-image-photos {
    filter: grayscale(100%) brightness(30%) sepia(100%) hue-rotate(-180deg) saturate(400%) contrast(0.9);
}

.icon-photos:focus .icon-text {
    background: rgb(0, 0, 118);
    color: white;
    margin: 0px;
}

.icon-photos:focus .border-box {
    border: rgb(0, 0, 0) dotted 1px;
}

.icon-image-photos {
    width: 30px;
    height: 30px;
    margin-bottom: 5px;
}

